  return (
    <div className="App">
      <header className="App-header">
        <LikeButton />
        <RetweetButton />
      </header>
    </div>
  );
}
 
function LikeButton() {
  const count = 999;
  return <span>♥ {count}</span>;
}
 

function RetweetButton() {
  return <span>リツイートボタン予定地</span>;
}
export default App;
